		<main><div class=container><div class="row clearfix"><section><h2 class=nubbin>Experience<i class="fa fa-desktop" aria-hidden=true></i></h2><div class=section--body><ol class=timeline><li class=timeline__item itemprop=worksFor itemscope itemtype="http://schema.org/Corporation"><h3 class=timeline__heading itemprop=name>Facebook<i class="fa fa-facebook-square fa-fw" aria-hidden=true></i> / WhatsApp<i class="fa fa-whatsapp fa-fw" aria-hidden=true></i></h3><div class=timeline__subheading><h4>Front-End Engineer</h4><h5>May 2018 &#8212; Present</h5></div><div class=timeline__body><p>Working on the <a href="https://www.facebook.com/business/tools/business-manager" target=_blank rel=noopener>Facebook Business Manager</a> to build WhatsApp Account Manager so businesses using <a href="https://www.whatsapp.com/business/api" target=_blank rel=noopener>WhatsApp Business API</a> all around the world can leverage the WhatsApp messaging platform to connect with their customers on WhatsApp in a simple, secure, and reliable way.</p></div></li><li class=timeline__item itemprop=worksFor itemscope itemtype="http://schema.org/Corporation"><h3 class=timeline__heading itemprop=name>LinkedIn<i class="fa fa-linkedin-square fa-fw" aria-hidden=true></i></h3><div class=timeline__subheading><h4>Staff Software Engineer</h4><h5>April 2014 &#8212; May 2018</h5></div><div class=timeline__body><p>Worked on <a href="https://business.linkedin.com/talent-solutions/recruiter" target=_blank rel=noopener>LinkedIn Recruiter</a>, a premier enterprise product to enhance the search capabilities with rich user interface connecting job seekers to opportunities at a massive scale. Previously I lead the front-end engineering for the LinkedIn Referrals product along with various other projects at <a href="https://business.linkedin.com/talent-solutions" target="_blank" rel=noopener>LinkedIn Talent Solutions</a> organization.</p></div></li><li class=timeline__item><h3 class=timeline__heading>Garmin International</h3><div class=timeline__subheading><h4>Internet App Developer</h4><h5>June 2010 &#8212; April 2014</h5></div><div class=timeline__body><p>Worked on a multitude of customer facing and internal web applications, most notably the end-to-end redesign of <a href="https://buy.garmin.com/" target=_blank rel=noopener>Garmin&apos;s eCommerce</a> website. Worked on the whole spectrum of Garmin&apos;s IT infrastructure starting from data-storage, services and front-end interface design.</p></div></li><li class=timeline__item><h3 class=timeline__heading>Kansas City Homes</h3><div class=timeline__subheading><h4>Web Developer</h4><h5>April 2009 &#8212; June 2010</h5></div><div class=timeline__body><p>As a lone web developer for the company, I handled all internal and external web applications starting from user facing property search interfaces with interactive maps to <a href="http://www.kchagent.com/" target=_blank rel=noopener>internal sites</a> for company Agents. Using <em>.net</em> technologies I implemented Competitive Market Analysis tools, Map search interfaces, <a href="http://www.kansascityhomes.com/newhomes/CommunityMap.aspx" target=_blank rel=noopener>community map</a> tools and agent sites with customizable templates.</p></div></li><li class=timeline__item><h3 class=timeline__heading>Sprint</h3><div class=timeline__subheading><h4>Web Developer</h4><h5>Feb 2007 &#8212; April 2009</h5></div><div class=timeline__body><p>Fresh out of college, I was designing and programming new web based applications/tools to support internal teams using PHP, Perl, JSP, Oracle, PostgreSQL etc.</p></div></li><li class=timeline__item><h3 class=timeline__heading>Missouri S&amp;T</h3><div class=timeline__subheading><h4>Web Developer</h4><h5>Nov 2004 &#8212; Dec 2006</h5></div><div class=timeline__body><p>My first large scale web development experience started as a graduate project where I used <em>Perl</em> and <em>Oracle</em> DB to design a website for database entry and query interface for research data from the Friction Stir Welding project under department of Metallurgy.</p></div></li></ol></div></section></div>

